import React from 'react';
import classes from './AboutCard.css';

const aboutCard = (props) => {
    return (
        <section>
            <section>
                <img src={props.src} alt={props.alt} />
            </section>
            <section>
                <div>{props.children[0]}</div>
                <hr></hr>
                <div>{props.children[1]}</div>
            </section>
        </section>
    );
}

export default aboutCard;
